    /**
     * 根据部门名称获取部门ID
     *
     * @param nodeList
     * @param depNameList
     * @return
     */
    private static void getDepIdByDepNames(List<Node<Department>> nodeList, List<String> depNameList, Set<Long> dingDepIds) {
        // 列表判空
        if (CollectionUtils.isEmpty(nodeList)) {
            return;
        }
        // 根据部门名称获取部门ID
        for (Node<Department> departmentNodeChild : nodeList) {
            if (depNameList.contains(departmentNodeChild.getValue().getName())) {
                dingDepIds.add(departmentNodeChild.getValue().getId());
                continue;
            }
            if (departmentNodeChild.hasChildren()) {
                getDepIdByDepNames(departmentNodeChild.getChildren(), depNameList, dingDepIds);
            }
        }
    }

