class TestSerial {
    public <T> T deserialize(String treeStr, Class<T> clazz) throws IOException, ClassNotFoundException {
        byte[] treeByte = Base64.getDecoder().decode(treeStr);
        ObjectInputStream objectInputStream = new ObjectInputStream(new ByteArrayInputStream(treeByte));
        objectInputStream.close();
        Object object = objectInputStream.readObject();
        if (clazz.isInstance(object)) {
            return (T) object;
        } else {
            throw new ClassCastException();
        }
    }
}
